import React from "react";
import { Users, Barcode } from "lucide-react";

export default function Dashboard({ Card, ContentSection, AdminTable }) {
  const lessons = ["บทที่ 1", "บทที่ 2", "บทที่ 3"];
  const words = ["1", "2", "3"];
  const questions = lessons;

  const admins = [
    { username: "Clark", email: "adminclark@gmail.com", role: "Admin1" },
    { username: "Ethan", email: "adminethan@gmail.com", role: "Admin2" },
  ];

  return (
    <div className="p-6 space-y-6">
      <h1 className="text-2xl font-bold">Dashboard</h1>

      <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
        <Card title="Total Users" value="0" icon={Users} />
        <Card title="Content Items" value="53" icon={Barcode} />
      </div>

      <div>
        <h2 className="text-xl font-semibold mb-4">Content Management</h2>
        <div className="flex justify-between mb-4">
          <input type="text" placeholder="Search" className="border rounded-md px-3 py-2 text-sm" />
          <button className="bg-black text-white px-4 py-2 rounded-md">+ Add</button>
        </div>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          <ContentSection title="บทเรียน" items={lessons} />
          <ContentSection title="คำศัพท์" items={words} />
          <ContentSection title="คำถาม" items={questions} />
        </div>
      </div>

      <AdminTable data={admins} />
    </div>
  );
}
